After inspecting the two ways NT104 can expand in CNF:

  1. NT104 → NT2 NT122  
     - NT2’s terminal yields are {t4, t21, t14, …}  
     - NT122’s terminal yields are {t26, t11, t20}  
     ⇒ NT104 cannot start with t30.  
  2. NT104 → NT3 NT52  
     - NT3’s terminal yields are {t5, t25, …}  
     - NT52’s terminal yields are {t28, t11, t17, …}  
     ⇒ NT104 still cannot start with t30.

Since S → NT104 NT26, the very first terminal of any S‐derivation must come from NT104, but NT104 can never produce t30 as its first terminal. The target string begins with t30, so it cannot be derived.  

